import React from "react";
import Book from "../components/Book"

function Results(props) {
  console.log("RESULTS PROPS", props);

  function validProps() {
    if (props) {
      return (
        <Book
          {...props.items[0].volumeInfo.title}
        ></Book>
      )
    }
  }

  return (
    <div className="book-list">
      {props.items[0].volumeInfo.title}
      <Book></Book>
    </div>
  );
}

export default Results;
